import { connect } from "react-redux";
import ReceiptForm from "../components/ReceiptForm";
import React from "react";
import { addReceipt } from "../components/Redux/Actions";

class ReceiptFormContainer extends React.Component {
  render() {
    return <ReceiptForm {...this.props} />;
  }
}

const mapDispatchToProps = (dispatch) => ({
  addReceipt: () => dispatch(addReceipt()),
});

export default connect(() => ({}), mapDispatchToProps)(ReceiptFormContainer);
